/**
 * @param {number[][]} nums
 * @return {number[]}
 */
var findDiagonalOrder = function(nums) {
  const rows = [];
  for (let i = 0; i < nums.length; i++) {
    const col = nums[i];
    for (let j = 0; j < col.length; j++) {
      const cell = col[j];
      const row = i + j;
      // console.log('findDiagonalOrder -> rows', rows);
      if (rows[row]) {
        rows[row].push(cell);
      } else {
        rows[row] = [cell];
      }
    }
  }
  // console.log('findDiagonalOrder -> rows', rows);
  let ans = [];
  for (let i = 0; i < rows.length; i++) {
    const row = rows[i];
    if (!row) continue;
    for (let j = 0; j < row.length; j++) {
      const element = row[row.length - j - 1];
      if (element) {
        ans.push(element);
      }
    }
  }

  return ans;
};

console.log(
  findDiagonalOrder([
    [1, 2, 3],
    [4, 5, 6],
    [7, 8, 9]
  ])
);

